const defaultState = {
  inputValue: '请输入内容',
  list: ['早上4点起来，锻炼身体', '中午下班游泳一个小时']
} 
export default ( state = defaultState, action ) => {
  console.log(state, action)
  // 就是一个方法函数
  // state是整个项目中需要管理的数据信息，这里我们没有什么数据，所以用空对象来表示。
  return state
}
